import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom"

function App() {
  return (
    <div className="App">
      <Router> 
        <Routes>
          <Route path="/" element={<home />} />
          <Route path="projects" element={<Projects />} />
          <Route path="experience" experience={<experience />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
